import {
  useEffect,
  useState
} from "react";

import $ from 'jquery';
const Paginate = ()=>{
  const[data,setData] = useState([]);
  const getData = ()=>{
    $.ajax({
      type: "GET",
      url: "https://jsonplaceholder.typicode.com/photos?_start=0&_limit=16",
      success: (response)=>{
        return setData((oldData)=>{
          return [
            ...oldData,
            response
          ]
        })
      }

    });
  }

  useEffect(getData,[]);
  const design = (
    <>
      <div className="container">
        <div className="row">
          {
            data.map((item)=>{
                console.log(item)
            })
          }
        </div>
      </div>
    </>
  );
  return design;
}

export default Paginate;
